window.bookSummaryJSON = "After 17-year-old Charlotte Kane, the beautiful, brilliant, and brooding daughter of a rich widower, disappears on a drunken New Years' Eve snowmobile ride, a raging blizzard soon snuffs out all search efforts. When her body is found during the spring thaw four months later, preliminary evidence implicates her ex-boyfriend: Ojibwe bad-boy Solemn Winter Moon. But then a second Charlotte Kane turns up dead, and Cork isn't sure of anything any more."; 
